import Logo from '../../ressources/img/logo-font.png';
import { Toolbar, Typography } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
    menuBar: {

        position: "static",
        marginRight: theme.spacing(2),
    },
    root: {
        flexGrow: 1,
    }
}))

